import { routeGuard } from '../../../router/guard'

export default [
    {
        path: '/pedidos',
        name: 'Pedidos',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/Index.vue')
    },
    {
        path: '/pedidofranquia',
        name: 'PedidoFranquia',
        props: true,
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/PedidoFranquia.vue')
    },
    // {
    //     path: '/pedidofranquia/:idpedido/:numero',
    //     name: 'Pedido Franquia',
    //     beforeEnter: routeGuard,
    //     props: { idpedido: null, numero: null },
    //     component: () =>
    //         import ('../views/PedidoFranquia.vue')
    // },
    {
        path: '/pedidoslista',
        name: 'pedidoslista',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/VisualPedidos.vue')
  }
]
